==Aranhir==

[[File:Aranhir-1-.jpg|thumb|150px]]'''Aranhir''' is a [[Rangers of the North|Ranger]] from [[Evendim]] and the captain of the Gilminuial, a ship that suplies the [[Wardens of Annúminas]]. He and his crew, with the exception of [[List of minor The Lord of the Rings Online characters in Bree-land#Argirion|Argirion]] and [[List of minor The Lord of the Rings Online characters in Bree-land#Mindambeth|Mindambeth]], were drowned in [[Evendim]].<ref name="shipwrecked mariners">[[The Lord of the Rings Online: Shadows of Angmar]], ''The Tale of the Shipwrecked Mariners''</ref> The player, who was sended by Argirion to learn the fate of the Gilminuial's fate, finds him while he and the crew were repairing the ship. Aranhir sended the player back to [[Bree-land]] to search for their lost cargo at the banks of the [[Baranduin]] and to tell Argirion that all members of the crew survived.<ref name="shipwrecked mariners"/>

